import { React, Component } from 'react';
import './App.css';
import { Router, Route} from 'react-router-dom';
import RegisterPage from '../src/Components/Register';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Router>
          <Route path="/login" component={RegisterPage}/>
        </Router>
      </div>
    )
  }
}

export default App;
